import * as React from 'react';
import { View, StyleSheet } from 'react-native';
import { Button, Text, withTheme, ThemeProvider } from 'react-native-paper';

function MainApp({ theme }) {
  return (
    <View style={styles.container}>
      <Text theme={theme} style={styles.text}>Добро пожаловать в мое приложение!</Text>
      <Button icon="camera" mode="contained" onPress={() => console.log('Нажата кнопка')}>
        Нажми на меня
      </Button>
    </View>
  );
}

const ThemedApp = withTheme(MainApp);

export default function App() {
  return (
    <ThemeProvider>
      <ThemedApp />
    </ThemeProvider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 16,
  },
  text: {
    marginBottom: 20,
    fontSize: 20,
  },
});
